import React from "react"
import cs from "./Contacts.module.css"


const Contacts = (props) =>{
    return <div className={cs.contacts}>
       My contacts : {Object.keys(props.contacts).map(key=>{
            return <Contact key={key} ContactName={key} ContactValue={props.contacts[key]} />
    })}
    </div>
}

const Contact = (props) =>{
    return <span className={cs.contact}>
        {props.ContactValue &&
        <div>
        {props.ContactName} : {props.ContactValue}
        </div>
        }
    </span>
}


export default Contacts
